// src/components/Employee/EmployeeList.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './EmployeeList.css';

function EmployeeList() {
  const [employees, setEmployees] = useState([]);
  const [form, setForm] = useState({ id: 0, name: '', email: '', phone: '', department: '', designation: '' });
  const [errors, setErrors] = useState({});

  const fetchEmployees = async () => {
    const res = await axios.get('https://localhost:5001/api/Employee');
    setEmployees(res.data);
  };

  const validateForm = () => {
    const newErrors = {};
    if (!form.name) newErrors.name = 'Name is required';
    if (!form.email) newErrors.email = 'Email is required';
    if (!form.phone) newErrors.phone = 'Phone is required';
    if (!form.department) newErrors.department = 'Department is required';
    if (!form.designation) newErrors.designation = 'Designation is required';
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async () => {
    if (!validateForm()) return;

    if (form.id === 0) {
      await axios.post('https://localhost:5001/api/Employee', form);
    } else {
      await axios.put(`https://localhost:5001/api/Employee/${form.id}`, form);
    }
    fetchEmployees();
    setForm({ id: 0, name: '', email: '', phone: '', department: '', designation: '' });
  };

  const handleEdit = (emp) => {
    setForm(emp);
  };

  const handleDelete = async (id) => {
    await axios.delete(`https://localhost:5001/api/Employee/${id}`);
    fetchEmployees();
  };

  useEffect(() => {
    fetchEmployees();
  }, []);

  return (
    <div className="employee-container">
      <h2>Employee List</h2>
      <div className="employee-form">
        <input placeholder="Name" value={form.name} onChange={(e) => setForm({ ...form, name: e.target.value })} />
        {errors.name && <span className="error">{errors.name}</span>}

        <input placeholder="Email" value={form.email} onChange={(e) => setForm({ ...form, email: e.target.value })} />
        {errors.email && <span className="error">{errors.email}</span>}

        <input placeholder="Phone" value={form.phone} onChange={(e) => setForm({ ...form, phone: e.target.value })} />
        {errors.phone && <span className="error">{errors.phone}</span>}

        <input placeholder="Department" value={form.department} onChange={(e) => setForm({ ...form, department: e.target.value })} />
        {errors.department && <span className="error">{errors.department}</span>}

        <input placeholder="Designation" value={form.designation} onChange={(e) => setForm({ ...form, designation: e.target.value })} />
        {errors.designation && <span className="error">{errors.designation}</span>}

        <button className="submit-button" onClick={handleSubmit}>
          {form.id === 0 ? 'Add' : 'Update'} Employee
        </button>
      </div>

      <ul className="employee-list">
        {employees.map(emp => (
          <li key={emp.id} className="employee-item">
            <div>
              <strong>{emp.name}</strong> - {emp.email}
            </div>
            <div>
              <button className="edit-button" onClick={() => handleEdit(emp)}>Edit</button>
              <button className="delete-button" onClick={() => handleDelete(emp.id)}>Delete</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default EmployeeList;
